class Album{
    constructor(id, title, imageUrl, artist, price, category, releaseDate){
        this.id = id;
        this.title = title;
        this.imageUrl = imageUrl;
        this.artist = artist;
        this.price = price;
        this.category = category;
        this.releaseDate = releaseDate;

    }
}

export default Album;
